import React from "react";
import extracy from "./extracy_logo.png";

const RightPanel = () => {
  return (
    <div>
      <img
        src={extracy}
        alt=""
        style={{
          position: "relative",
          top: "20vh",
          left: "7vw",
          width: "55vw",
        }}
      ></img>
    </div>
  );
};

export default RightPanel;
